INSERT INTO `rate` (`id`, `title`, `content`, `sId`) VALUES (328, '2017年华东师范大学050108比较文学与世界文学考研报录比', '\n\r\n	　　说明：1、一志愿复试总分未统计少数民族高层次骨干人才计划考生、单考生、破格复试和上海“教硕-规培”计划考生。\n\r\n	　　2、报考人数为一志愿报考人数。录取人数为录取总人数包含调剂、推免、和各种专项计划。\n\r\n	　　3、一志愿上线人数不含推免生、单考生和少数民族高层次骨干人才计划考生，但是包含上海“教硕-规培”专项计划上线人数，部分专业录取人数大于一志愿上线人数，是因该专业录取了一些专项计划和调剂生。\n\r\n	　　4、一志愿上线人数为零时，下表中给出的复试分数线为适用我校的国家线。\n\r\n	　　5、生成本年度数据后，请核对复试分数总分（在“上线人数”链接中有个“复试最低分”查询条件）\n\n\n\n\n\n序号\n\n\n学习形式\n\n招生年份\n\n招生院系\n\n招生专业\n\n报考人数\n\n第一志愿\r\n				上线人数\n\n推免人数\n\n录取总数\n\n一志愿复\r\n				试最低分\n\n单科线一\r\n				(总分100)\n\n单科线二\r\n				(总分>100)\n\n\n\n\n\n\n1\n\n\n\n全日制\n\n\n\n2017\n\n\n\n101人文社会科学学院中国语言文学系\n\n\n\n050108比较文学与世界文学\n\n\n\n87\n\n\n\n23\n\n\n\n6\n\n\n\n10\n\n\n\n366\n\n\n\n53\n\n\n\n80\n\n\n\n\n', 34);
